import "./styles/home.css"
function HomePage(props){
    return(
        <div className="home-page-wrapper">
            <div className="tech-bg-wrapper">
                {props.data.backgroundBoxes.map(items=>(
                    <div className="tech-bg-elements">
                        {(items.num===3)?
                            <>
                                <h3>{items.title}</h3>
                                <p>{items.category} / {items.date}</p>
                            </>:<>
                                <></>
                            </>
                        }
                    </div>
                ))}
            </div>
        </div>
    )
}

export default HomePage
